import React from 'react';

import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Auth from 'pages/Auth';
import Todo from 'pages/Todo';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route element={<Auth />} path="auth" />
        <Route element={<Todo />} path="todo" />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
